import styled from "@emotion/styled";
import { AppBar, Toolbar } from "@mui/material";
import React from "react";

const StyledToolbar = () => styled(Toolbar)

const Navbar = () => {
  return (
    <AppBar position="sticky">
      <Toolbar>Navbar</Toolbar>
    </AppBar>
  );
};

export default Navbar;
